import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Product from './components/Product';
class App extends Component {
  render () {
    return (
      <div>
        <Header></Header>
        <Product></Product>
      </div>
    );
  }
}

export default App;
